(4, 'Encuentre mediante subconsulta profesores (ID,name) que no enseñen ninguna asignatura. ', 'LEFT OUTER JOIN ', 'π ID,name(σ teaches.course_id IS null)(instructor⟕teaches)', 'SELECT `ID`,`name` FROM `instructor`  NATURAL LEFT OUTER JOIN `teaches` WHERE teaches.course_id IS null;', '[{\"ID\": \"63395\", \"Name\": \"McKinnon\"}, {\"ID\": \"78699\", \"Name\": \"Pingr\"}, {\"ID\": \"96895\", \"Name\": \"Mird\"}, {\"ID\": \"4034\", \"Name\": \"Murata\"}, {\"ID\": \"50885\", \"Name\": \"Konstantinides\"}, {\"ID\": \"79653\", \"Name\": \"Levine\"}, {\"ID\": \"97302\", \"Name\": \"Bertolino\"}, {\"ID\": \"57180\", \"Name\": \"Hau\"}, {\"ID\": \"35579\", \"Name\": \"Soisalon-Soininen\"}, {\"ID\": \"31955\", \"Name\": \"Moreira\"}, {\"ID\": \"37687\", \"Name\": \"Arias\"}, {\"ID\": \"16807\", \"Name\": \"Yazdi\"}, {\"ID\": \"95030\", \"Name\": \"Arinb\"}, {\"ID\": \"74426\", \"Name\": \"Kenje\"}, {\"ID\": \"58558\", \"Name\": \"Dusserre\"}, {\"ID\": \"59795\", \"Name\": \"Desyl\"}, {\"ID\": \"52647\", \"Name\": \"Bancilhon\"}, {\"ID\": \"72553\", \"Name\": \"Yin\"}, {\"ID\": \"64871\", \"Name\": \"Gutierrez\"}]', '0000-00-00', '2022-12-07 16:52:40', '72351581K', 'SERGIO@localhost'),
(5, 'Determine el nombre del profesor que esté enseñando alguna asignatura del departamento de English, cuyo nombre empieze con \"Ke\". Asegurese de que no existen nombres duplicados en el resultado.', 'Una proyección del nombre del profesor buscando co', 'π name(σ dept_name = English ∧ name /A Ke%)(instructor)', 'SELECT DISTINCT `name` FROM `instructor` WHERE `dept_name` =\'English\' AND `name` LIKE \'Ke%\'', '[{\"name\": \"Kean\"}]', '0000-00-00', '2022-12-07 17:30:43', '72351581K', 'SERGIO@localhost'),
(6, 'Seleccione el Id del profesor que enseña la asignatura 2760 en Primavera (Spring) y tiene la clase en el edificio Saucon.', 'INNER JOIN con 3 tablas', 'π ID (σ teaches.semester = Spring ∧ course.course_id = \'2760\' ∧ department.building = Saucon)(teaches⨝course⨝department)', 'SELECT `ID` FROM `teaches` INNER JOIN `course` ON teaches.course_id = course.course_id INNER JOIN `department` ON course.dept_name = department.dept_name  WHERE teaches.semester = \'Spring\' AND course.course_id = \'2760\' AND department.building = \'Saucon\'', '[{\"ID\": \"79081\"}]', '0000-00-00', '2022-12-07 17:21:33', '72351581K', 'SERGIO@localhost');
